import React from 'react';


class Admin extends React.PureComponent{

	render(){
		return <div>
        <h1>Admin Login</h1>
        <text>Enter Username</text>
        <text>Enter Password</text>
        <button>Submit</button>
        </div>
	}
}

export default Admin;
